window.bookSummaryJSON = "<p>This box set contains all five books of the Wrong Side of the Tracks series.</p> <p>BOOK 1- SCUM</p> <p>Shane. Ex-con. No-good bastard. Scum.</p> <p>Rosen. Trust fund boy. Virgin. Sucker.</p> <p>Shane is straight out of prison, and plans to wreck everything dear to the man who put him behind bars. And number one on that list is Rosen, Ed Beck’s son. Shane’s plan is to incriminate the boy, but when the dreamy blue eyes meet his, Shane can think of a hundred other ways to ruin Rosen right under his father’s nose.</p> <p>BOOK 2 - PRIMAL</p> <p>Jag. Uninhibited. Possessive. Walks on the wild side.</p> <p>Dane. Gentle giant. Monster lover. Plays it safe.</p> <p>After being beaten half to death by his ex, Dane wakes up in a collar, chained to a wall by a wild man who claims Dane as his property.</p> <p>BOOK 3 - DICKHEAD</p> <p>Hammer. Enforcer for the Demon Brethren MC. Sociopath. Butcher. Weapon of choice: Sledgehammer</p> <p>Dex. Shameless. Perpetually horny. No impulse control. Weapon of choice: Dumb jokes</p> <p>From the moment Dex saw Hammer smash a man’s head open like it was a watermelon, he was obsessed. He is thrilled when life offers him the opportunity to introduce himself to the bloodthirsty biker god. So maybe it’s not so perfect that Hammer is his prisoner, but beggars can’t be choosers.</p> <p>BOOK 4 - GRIND</p> <p>Ezra. Escort. Cynical. Hunted by a killer. Needs a man capable of anything.</p> <p>Frank. Client. Protective. Loyal. Wants to forget his violent past.</p> <p>On his 40th birthday, Frank decides his chance for love has passed. But when an old friend treats him to a night with a beautiful escort, Frank is not about to say no. That is, until one night Ezra arrives on his doorstep, desperate for protection from none other than Frank’s old buddy. A man as dangerous as Frank used to be.</p> <p>BOOK 5 - WANTED</p> <p>Liver. F--kboy extraordinaire. Race car driver. Cocky. Horny. Would kill for his best friend.</p> <p>Knox. Kickboxer with a chip on his shoulder and a heart condition. Crybaby. Would get rid of a body for his best friend.</p>"; 
